    "2013-03-14T19:25:28.325054",nt"name": "san-diego-littoral-cell-crsmp-sensitive-habitat-2009",nt"isopen":
    false,nt"url": null,nt"notes": "Specific concerns relate to the threatened
    snowy ploveru2019s critical habitat, including nesting and wintering locations,
    as well as the endangered least ternu2019s nesting locations. Least terns are visual
    predators on small schooling fish and their chicks are vulnerable when left unattended
    at nesting sites. The potential for construction-related disturbance or turbidity
    generated during sediment placement to interfere with nesting or foraging success
    are concerns that require protective measures when these protected species are nearby.
    The suitability of habitat for grunion spawning or their presence during beach nourishment
    needs to be evaluated and protective measures implemented if necessary. While other
    sensitive biota may be present at or near project locations, measures implemented
    to protect water quality and sensitive habitats are generally protective of other
    species.Locations compiled by SAIC and submitted to CSMW by SANDAG as part of the
    San Diego County Coastal Regional Sediment Management Plan (2009).",nt"license_title":
